import React from "react";

const Team = () => {
  return (
    <div>
      <div className="basic-2">
        <div className="container">
          <div className="row">
            <div className="col-lg-12">
              <h2>Our Team Of Consultants</h2>
              <p className="p-heading">
                is simply dummy text of the printing and typesetting industry.
                Lorem Ipsum has been the industry's standard dummy text ever
                since the 1500s, when an unknown printer took a galley of type
                and scrambled it to make a type specimen book. It has
              </p>
            </div>{" "}
            {/* end of col */}
          </div>{" "}
          {/* end of row */}
          <div className="row">
            <div className="col-lg-12">
              {/* Team Member */}
              <div className="team-member">
                <div className="image-wrapper">
                  <img
                    className="img-fluid"
                    src="assets/images/team-1.png"
                    alt="alternative"
                  />
                </div>{" "}
                {/* end of image-wrapper */}
                <p className="p-large">John Whitelong</p>
                <p className="job-title">General Manager</p>
              </div>{" "}
              {/* end of team-member */}
              {/* end of team member */}
              {/* Team Member */}
              <div className="team-member">
                <div className="image-wrapper">
                  <img
                    className="img-fluid"
                    src="assets/images/team-2.png"
                    alt="alternative"
                  />
                </div>{" "}
                {/* end of image wrapper */}
                <p className="p-large">Veronique Smith</p>
                <p className="job-title">Business Developer</p>
              </div>{" "}
              {/* end of team-member */}
              {/* end of team member */}
              {/* Team Member */}
              <div className="team-member">
                <div className="image-wrapper">
                  <img
                    className="img-fluid"
                    src="assets/images/team-3.png"
                    alt="alternative"
                  />
                </div>{" "}
                {/* end of image wrapper */}
                <p className="p-large">Chris Zimerman</p>
                <p className="job-title">Online Marketer</p>
              </div>{" "}
              {/* end of team-member */}
              {/* end of team member */}
              {/* Team Member */}
              <div className="team-member">
                <div className="image-wrapper">
                  <img
                    className="img-fluid"
                    src="assets/images/team-4.png"
                    alt="alternative"
                  />
                </div>{" "}
                {/* end of image wrapper */}
                <p className="p-large">Mary Villalonga</p>
                <p className="job-title">Community Manager</p>
              </div>{" "}
              {/* end of team-member */}
              {/* end of team member */}
            </div>{" "}
            {/* end of col */}
          </div>{" "}
          {/* end of row */}
        </div>{" "}
        {/* end of container */}
      </div>{" "}
      {/* end of basic-2 */}
      {/* end of team */}
    </div>
  );
};

export default Team;
